INSERT INTO `votes` VALUES (0,'','白皓',296,'白皓，教授，河北昌黎人。2006，获得日本仙台东北大学金属工学研究科博士学位，2006-2012任北京科技大学冶金与生态学院，副教授；2012至今任北京科技大学冶金与生态学院，教授。主要从事工业生态与冶金清洁生产及能源与环保新技术研究。主持和参与自然科学基金面上和重点项目、863项目和省部级纵向科研项目10余项，在国内外发表论文100多篇。承担的省部级课题“高炉热风炉蓄热体高辐射覆层技术”获得2008年中华全国工商业联合会科技进步奖一等奖。目前兼任中国机械工程学会高级会员、中国机械工程学会工业炉分会理事、日本铁钢学会会员、美国矿业、金属与材料学会（TMS）会员、中国国际咨询工程公司咨询评估专家、国家留学基金评审专家和中国工业节能与清洁生产协会专家。','/img1/1.jpg'),(0,NULL,'曹文斌',297,'曹文斌，教授，博导，材料学院副院长，无机非金属材料系主任，1998年博士毕业于北京科技大学，1998.7~2000.6年在北京理工大学做博士后研究，2000.7~2002.6日本大阪大学COE研究员，2002年7月至今，于北京科技大学材料学院任教。中国感光学会光催化专业委员会委员，中国硅酸盐学会特种陶瓷分会理事。2003年入选北京市“科技新星”；2007年入选教育部“新世纪优秀人才”；2011年入选“北京市优秀人才”。作为课题负责人先后承担国家十三五重点研发计划课题、863项目重大课题、国家自然科学基金等多个研究项目。在APL、J. Am. Ceram. Soc、J. Mol. Catal. A等刊物上发表论文100多篇，获得和申报发明专利十余项。编辑出版英文专著2部，合著中文专著1本。','/img1/2.jpg'),(0,NULL,'陈艳萍',298,'陈艳萍，教授，博导，副院长，调和分析与小波梯队，本科生课程：常微分方程，复变函数与积分变换，线性代数；研究生课程：实分析概论；研究领域：调和分析及其应用，奇异积分算子、变差算子、二阶椭圆算子。自2007年以来，在Anal.&PDE、Trans.Amer.Math.Soc.、J.Funct.Anal.、Rev.Mat.Iberoam.、J.Goem.Anal.、Canada.J.Math.、Potential Analysis 、Nonlinear Anal-Theor、J. Math. Anal. Appl.、Forum Math.、Studia Math.、中国科学(英文版)等国内外知名的杂志上发表SCI论文40余篇。曾获得全国优秀博士学位论文提名、数理学院“2009-2010年度优秀班导师”、教育部“新世纪优秀人才支持计划”、数理学院“第九届本科教学优秀奖、北京科技大学“2012年度就业工作贡献教师奖”等。“奇异积分算子的有界性研究”被评为2012年度北京科技大学优秀成果奖。','/img1/3.jpg'),(0,NULL,'丁大伟',299,'丁大伟，教授，博导，自动化学院院长助理，控制科学与工程系系主任。北京自动化学会理事，自适应动态规划与强化学习专业委员会委员。2003年获得中国海洋大学自动化学士学位。2010年获得东北大学控制理论与控制工程博士学位。2010年开始在北京科技大学工作至今。在此期间曾访问德国马普学会复杂系统与动力学研究所、美国加州大学伯克利分校机械工程系、新加坡南洋理工大学电气与电子工程系、加拿大维多利亚大学机械工程系等单位。2013年获教育部新世纪优秀人才称号。','/img1/4.jpg'),(0,NULL,'范慧俐',300,'范慧俐，教授，硕导。1995年入校，一直从事一线教学科研工作。在教育教学上，她爱岗敬业，教书育人，为人师表，诲人不倦，被评为北京科技大学师德榜样。先后为本科生、研究生讲授“有机化学”、“有机波谱分析”和“有机功能材料”等课程。教学效果突出，先后荣获“第六届北京科技大学青年教师课堂教学奖”一等奖；“北京高校第二届青年教师教学基本功比赛”二等奖和“建龙优秀教师奖”。五次被本科毕业生评为“我爱我师——我心目中最优秀的老师”。并于2016年获我爱我师优秀教师金质奖章。所授本科生和研究生课程均为免检课堂。在科研方面，先后主持国家自然科学基金项目，科技部重大研发计划项目，国防科工委项目等。指导学生获全国大学生化学实验竞赛一等奖1人、二等奖2人和三等奖3人。','/img1/5.jpg'),(0,NULL,'范一亭',301,'范一亭，副教授，硕导，院长助理，英文系主任。已出版专著1部、研究生专业教材1部，主持教育部人文社会科学项目1项，在英国《维多利亚研究协会通讯》《外国文学评论》《国外文学》、台湾《英美文学评论》等国内外核心期刊上发表论文、报告等十余篇，翻译或合译作品达百万字。作为主要参与人参与了英语语言文学学科2017版研究生培养方案的修订工作；先后协助学科带头人组织了“外国文学前沿话语高端论坛”、“莎士比亚之夜”、“英国戏剧学术周”等重大学术活动，作为主要参与人先后荣获北京科技大学教育教学成果奖3个特等奖，先后荣获外语学院“先进工作者”、“科研论文一等奖”、校级优秀班导师、校级优秀共产党员等称号。','/img1/6.jpg'),(0,NULL,'冯明',302,'冯明，博导，机械电子工程系主任，主攻先进机电系统技术方向。1985年获得北京航空学院分院机械设计与制造专业学士学位，1990年获得北京航空航天大学机械学专业硕士学位，2003年获得日本东京工业大学博士学位。1985年本科毕业后在北京航空航天大学担任副教授，2003年出国日本，在日本电产株式会社担任次长，2007年回国在北京科技大学机械电子工程系担任教授。曾凭借“跨超高超声速风洞模型自由翻滚动导数实验技术”获得中国人民解放军总装备部科技进步二等奖，凭借“921－3模型跨超高超声速动导数实验技术”获得中国国防科学技术工业委员会科技进步二等奖，凭借“液体动静压混合轴承的研究及其推广应用”获得中国航空工业总公司科技进步二等奖，凭借“利用前缘表面转动控制边条翼外翼分离研究”获得中国航空工业总公司科技进步三等奖。','/img1/7.jpg'),(0,NULL,'冯志鹏',303,'冯志鹏，教授，博导。2010年担任加拿大Ottawa大学机械工程系Visiting Professor，2013年至今担任北京科技大学机械工程学院车辆工程系教授兼博导。作为负责人主持国家重点研发项目1项，国家自然科学基金面上和青年项目5项，教育部和北京市自然科学基金项目3项。在Mechanical Systems and Signal Processing、Journal of Sound and Vibration、IEEE和ASME等权威期刊上发表SCI论文40余篇，其中第一作者28篇，唯一通讯作者6篇。第一作者论文中ESI高被引论文4篇，单篇论文最高SCI他引210余次，第一和唯一通讯作者中国科学院TOP期刊论文10篇，累计SCI他引1000余次。第一作者专著2本。获得2006年度教育部高等学校科学技术奖科技进步二等奖，2010 PHM国际学术会议最佳论文奖，2014年度Renewable Energy (SCI影响因子4.900)最佳论文奖。2012年入选教育部新世纪优秀人才支持计划。','/img1/8.jpg'),(0,NULL,'惠希东',304,'惠希东，博导。中国金属学会非晶合金分会副主任委员，中国材料研究学会凝固科学与技术副主任委员，中国材料研究学会金属间化合物与非晶合金分会秘书长，曾荣获北京科技大学师德先进个人，教育部跨世纪优秀人才，国务院政府特殊津贴专家。长期从事非晶态合金及其他亚稳材料研究，在非晶合金的结构与强韧化方面做出了多项创新性成果。曾荣获国家技术发明二等奖1项，省部级科技进步一等奖1项，省部级科技进步二等奖3项。先后主持了国家863计划、国家973计划、国家自然科学基金重点项目等10余项课题。在国内外学术杂志上发表论文150余篇，其中被SCI收录的论文120余篇，编著和参编了《块体非晶合金》与《金属材料学》等书籍，申请和获得了国家发明专利30余项。共指导博士和硕士研究生60余名。','/img1/9.jpg'),(0,NULL,'李金许',305,'李金许，教授，博导，河北人。1985年进入北京钢铁学院（1988年更名为北京科技大学）材料物理系，先后获得理学学士、工学硕士和工学博士学位，2002.3-2004.3在日本物质材料研究机构做特聘研究员（JSPS Fellow）。先后主持国家自然科学基金重点项目和面上项目等8项、国家“973”课题2项、国家重点研发项目课题1项，以及企业合作项目多项。曾获得教育部自然科学二等奖一项、科技进步一等奖一项、二等奖一项，冶金工业局科技进步二等奖一项，北京市科技进步奖二等奖一项，中国腐蚀与防护学会科学技术奖一等奖2项。在高水平期刊上发表论文100余篇，合作出版论著4部。目前担任中国腐蚀与防护学会理事，中国腐蚀与防护学会环境断裂专业委员会委员，并为Corrosion Science等多个国际学术期刊的审稿人。','/img1/10.jpg'),(0,NULL,'李立东',306,'李立东，教授，博导，德国马普学会胶体与界面研究所物理化学专业博士。2004年在德国马普学会胶体与界面研究所进行博士后研究工作。2005年任中国科学院理化技术研究所研究员，博导。2007年至今作为北京科技大学“高层次创新引进人才”到校从事教学与科研工作。主要从事新型光电功能材料的研究。承担科技部重大专项，国家自然科学基金，教育部及北京市科委重大专项等项目。申请发明专利22项，发表SCI论文120余篇，部分研究成果发表在国际著名期刊“Angewandle Chemie International Edition”,“Advanced Materials”,“Journal of the American Chemical Society”和“Chemistry Materials”等。2004年在德国留学期间，获得首届中国政府优秀海外留学人员奖学金。2008年获教育部新世纪优秀人才计划资助，2014年获教育部技术发明奖一等奖，2015年获国家技术发明奖二等奖。','/img1/11.jpg'),(0,NULL,'李延祥',307,'李延祥，教授，博导，民盟北科大支部副主委兼宣传委员。1981年7月毕业于铁岭高中。1985年7月本科毕业于东北大学（原东北工学院）有色金属冶金系有色金属金属冶炼专业。1988年6月硕士研究生毕业北京科技大学（原北京钢铁学院）冶金物理化学系，获中国科技大学理学硕士学位。1988年9月年至1990年6月在国家民政部工作。1995年6月获北京科技大学工学博士学位。从1985年9月起师从柯俊院士先后攻读硕士、博士学位，是中国有色金属冶金考古和冶金史的主要研究者之一。','/img1/12.jpg'),(0,NULL,'李远',308,'李远，副教授，辽宁省沈阳人，1998年考入北京科技大学交通土建工程专业，2002-2008年获北京科技大学岩土工程专业博士学位，毕业后留任土木系教师，2013年被聘为土木系副教授，硕士研究生导师，2015-2016年赴美国明尼苏达大学以访问学者身份进行学术访学。主要从事岩石力学本构、数值仿真工程应用、岩土数字化、地应力测量及相关岩土工程测量技术方面研究。目前主要负责承担科技部政府间国际合作重点专项1项，并担任科技部国家重点研发计划专项执行课题长1项。获得省部级奖励2项，发表学术论文10多篇，发明专利授权3项。','/img1/13.jpg'),(0,NULL,'李子富',309,'李子富，教授，博导，系主任。博士毕业于德国汉堡工业大学水技术研究所，曾担任德国埃森大学城市水资源研究所研究员、美国加州理工学院高级研究学者。现兼任科技部环境与能源国际科技合作基地主任、工业典型污染物资源化处理北京市重点实验室主任、国际杂志《Water Science and Technology》编辑、全国专业标准化技术委员会SAC/TC451委员、中国景区协会厕所革命推进会专家组组长。主持和参与完成10余项国家级项目、20余项国际合作项目、多项省部级及校企合作项目。发表论文100余篇，获授权发明专利10余项；主编/参编著作10余部。获北京科技大学第十四届“我爱我师”我最喜爱的专业课教师、2017年度“感动北科”新闻人物、第9、11届十佳学术之星优秀导师、优秀留学生导师等荣誉称号。','/img1/14.jpg'),(0,NULL,'刘风琴',310,'刘风琴，教授，博导，现任冶金与生态工程学院有色冶金系系主任。“新世纪百、千、万人才工程”国家级人选，国务院政府特殊津贴专家，获第二届国家杰出工程师奖；中南大学、江西理工大学、北方工业大学兼职教授；国家科技进步奖、国家技术发明奖评审专家；中国工程教育认证专家；中国有色金属学会轻金属冶金学术委员会第四、五、六届铝用炭素专业委员会主任委员；获得国家科技进步二奖2项（排名第一、第三）、省部级科技进步一等奖4项；撰写出版中英文专著4本，发表中英文论文60余篇；授权国家专利40余件；制订国家标准6项。','/img1/15.jpg'),(0,NULL,'乔兰',311,'乔兰，博导，副院长，主要从事岩土工程、工程力学和采矿工程等领域的“工程岩土体稳定性分析与控制技术”、“地应力测试技术理论与方法”、“工程地质灾害机理分析与控制技术”、“特殊土地基处理技术”等方面的科学研究与研究生教育工作。承担国家重点研发计划、国家自然科学基金、重点科技攻关、“863”计划、“973”计划等科研项目50余项，获得国家科技进步二等奖、国家技术发明三等奖等国家级奖励5项，省部级科技进步二等奖以上20项。出版学术专著2部，发表学术论文100余篇。培养博士30余名、硕士90余名。享受国务院政府特殊津贴，中国岩石力学与工程学会首届青年科技奖金奖。','/img1/16.jpg'),(0,NULL,'石志国',312,'石志国，教授，2011年8月入选北京市优秀人才培养资助计划，获2011 年北京高校青年教师教学基本功比赛一等奖，2014 年第十四届霍英东教育基金会高等院校青年教师奖二等奖，2018年北京市教学成果奖一等奖。研究方向为智能系统与物联网技术，参与完成国家重点研发计划2项，主持完成国家自然科学基金、国家保密局和中国科学院重点项目多项，同时承担了多项产学研转化的企业课题。在国内外期刊和学术会议发表SCI/EI论文50余篇，其中1区论文1篇，2区论文2篇，出版编著5部获图书奖2项。','/img1/17.jpg'),(0,NULL,'宋仁伯',313,'宋仁伯，教授，博导，1970年9月生，材料加工与控制工程系主任。2002年6月在北京科技大学获材料加工工程专业博士学位，2002年11月到日本东京大学先端科学技术研究中心高性能材料研究室，从事为期两年的博士后研究工作，于2004年12月回国在北京科技大学材料学院任教。主要研究方向为新材料的制备及加工、先进高强度钢铁材料的开发及组织性能控制等。作为项目负责人承担的主要课题有：国家“863”计划、国家自然科学基金、教育部留学回国人员科研启动基金、中国博士后科学基金、新金属材料国家重点实验室开放基金等科研项目共7项。近五年在国内外期刊发表检索论文59篇，其中SCI论文24篇，EI论文35篇，中文核心80篇，TOP期刊1区2篇，2区15篇。被引总数155，他引总数109，最高影响因子4.525。','/img1/18.jpg'),(0,NULL,'宋伟',314,'宋伟，副教授，廉政研究中心主任，2013年8月自清华大学博士后出站后来校任教。宋伟老师热爱同学，热爱教学工作，授课语言准确、生动，讲述条理清晰，教学基本功扎实，深受学生喜爱。他注重教学与科研的有机结合，在《政治学研究》等刊物上发表论文30余篇，出版专著4本，主持国家社科基金等十余项课题，多次受邀参加中央纪委理论研究座谈会，多次接受光明日报、人民日报、新华网等媒体专访。曾获得全国高校思想政治理论课教学标兵、第九届北京高校思想政治理论课教学基本功比赛一等奖、北京高校第十届青年教师教学基本功比赛三等奖、北京科技大学第八届“研究生教育奖”——研究生教学优秀奖等荣誉称号。','/img1/19.jpg'),(0,NULL,'孙昌爱',315,'孙昌爱，教授，博导。1997年毕业于北京科技大学，获计算机及应用学士学位；2002年毕业于北京航空航天大学，获计算机软件与理论博士学位。长期从事软件工程方面的研究与教学，在重要的国内外学术期刊与会议上发表论文80余篇，主持完成国家自然科学基金、北京市自然科学基金、教育部博士点基金、教育部留学回国人员科研启动基金10余项。曾在美国普渡大学、荷兰格罗宁根大学、澳大利亚斯文本大学、德国帕德博恩大学、香港理工大学从事学术研究与合作。担任UIC2015、TructCom2008等国际会议程序委员会主席，TrustCom2015等70多个国际会议程序委员会委员。IEEE高级会员、中国计算机学会高级会员、中国电子学会高级会员、中国计算机学会服务计算专委常务委员等。','/img1/20.jpg'),(0,NULL,'孙朝阳',316,'孙朝阳，教授，副院长，金属轻量化成形制造北京市重点实验室副主任。一直致力于多尺度微结构演化及其联合增强增塑与成形过程性能调控的理论和应用，逐步形成了“微结构与性能调控”的特色研究思路。先后主持高档数控机床与基础制造装备科技重大专项（子课题负责）、“十三五”装备预研共用技术、国家自然科学基金项目4项等在内的30余项相关研究课题；在IJP、MC、JMPT、IJMS、MD、MSE-A、机械工程学报、金属学报等国内外重要期刊上发表论文近80篇，其中SCI收录43篇，国家发明专利10项（授权6项），其中发表在机械工程、固体力学领域权威期刊“International Journal of Plasticity文章被选为“Top 25 Hottest Articles”、“Mostdownload Articles”和2016年ESI论文。获得教育部科技进步二等奖（第四名），受邀为精密成形技术通讯编委及IJP、IJMS、JMPT、MD、MSE-A、金属学报等数十个知名刊物审稿人。','/img1/21.jpg'),(0,NULL,'田建军',317,'田建军，教授，博导，现任北京科技大学新材料技术研究院功能材料研究所所长，光电功能材料与器件研究室负责人，教育部新世纪优秀人才。博士毕业于北京科技大学，随后去美国华盛顿大学学习交流，主要致力于光电功能材料与器件的研究，重点从事新型太阳能电池、发光二极管、探测器及相关材料的设计与优化，先后在Energy Environ. Sci.，Adv. Energy Mater.，ACS Energy Lett.，Coordin. Chem. Rev.，Nano Energy. 等期刊上发表学术论文100多篇。获省部级科技奖6项。应邀在国内外学术会议上做特邀报告或讲座30余次，主持国家、省部级及厂协等研究项目20余项。','/img1/22.jpg'),(0,NULL,'万向元',318,'万向元，博导，清华大学和美国康乃尔大学博士后。2018年荣获第十三批北京市有突出贡献的科学、技术、管理人才奖；万向元指导的张丹凤博士论文荣获中国作物学会优秀博士论文奖；2017年被评为北京市特聘专家；2016年被评为国家万人计划领军人才；作为团队带头人获批北京市青年拔尖团队资质；2014年被评为山东省泰山学者领军专家；作为团队负责人获批国家创新人才推进计划重点领域创新团队资质；2013年，荣获中关村国家级人才特区科技领军人才奖；2007年，荣获全国百篇优秀博士学位论文奖。迄今，在Nature Cell Biology、Molecular Plant、Plant Cell、PBJ、MCP、Genetics等上发表论文70多篇，SCI因子超240，引用次数超1500次。申请授权国家发明专利32项，主持和参加国家科研项目26项。','/img1/23.jpg'),(0,NULL,'王凤平',319,'王凤平，博导，获北京科技大学博士学位，并于物理所从事两年博士后研究。自1986年至今一直在北京科技大学从事教学科研工作，期间曾在加拿大西安大略大学访学三年。从事新型纳米光电功能材料及其器件物理研究；探索极端环境下非接触检测方法和技术。曾承担国家自然科学基金面上项目“光学级金刚石薄膜的差分反射研究”；现承担国家自然科学基金面上项目“基于无损检测的古建彩画颜料物质鉴别的理论与方法研究”；曾承担国家重大科研仪器设备研制专项基金项目的子项目。发表SCI学术论文100余篇。两位外籍学生分获校长奖章，两外籍学生获校优秀博士论文，1名博士和1名硕士获北京科技大学优秀博士和硕士论文；曾三次获北京科技大学留学生教育杰出贡献奖。','/img1/24.jpg'),(0,NULL,'王海娟',320,'王海娟，内蒙古赤峰人。2004年毕业于北京科技大学冶金工程系，同年9月进入北京科技大学冶金物理化学专业学习，并获硕士学位。2007年8月赴瑞典皇家工学院攻读博士。博士毕业后在瑞典从事4个月的博士后研究工作，于2011年6月加入北京科技大学冶金与生态工程学院钢铁冶金系，从事不锈钢、合金钢精炼，及铁合金工艺、精炼等方向的研究工作。迄今为止共发表文章23篇，包括英文17篇，中文6篇，其中SCI、EI收录13篇，参与申请专利5项，参加国际会议7次，并作大会报告。主持“高硅镍硅铁合金沉淀脱磷和还原脱磷渣磷容量的研究”，主持“引入二氧化碳转炉一步法冶炼中低碳铬铁”，参与国家科技支撑计划项目“CO2-O2混合喷吹炼钢工艺技术及装备”，参与自然科学基金重点基金“CO2应用于炼钢的基础理论研究”。','/img1/25.jpg'),(0,NULL,'王凯',321,'王凯，副教授，2004年6月，获武汉大学世界经济专业经济学博士学位，2012年晋升副教授。研究方向为国际直接投资、区域经济一体化，主讲“国际经济学”、“世界经济专题”、“研究方法与论文写作”等研究生课程。自2006年开始指导硕士研究生，包括普硕、留学生和MBA，其中已毕业研究生40余人。自2009年至2013年，担任经贸系研究生班主任；2013年至今，担任东凌经济管理学院的博士生班导师。2011年作为主要参与者参与的项目“加强培养环节管理，提高硕士研究生培养质量”获北京科技大学研究生教育教学成果特等奖；主编《国际贸易地理》、《市场营销学》等教材，参编《国际经济合作》及北京市精品教材《新编国际贸易理论与实务》，发表论文20余篇。2016年指导的国际贸易学专业的研究生王爱玲获国家奖学金。','/img1/26.jpg'),(0,NULL,'王丽娜',322,'王丽娜，2004年毕业于哈尔滨工业大学,获通信与信息系统专业工学博士学位，现为北京科技大学计算机与通信工程学院通信工程系副教授，从事教学和科研工作。目前主持的项目有国家自然科学基金项目和国家重点研发计划重点专项项目。2017年获得“中兴通讯杯”全国高等学校电子信息类专业青年教师授课竞赛华北赛区三等奖；主编的《卫星通信系统》一书被评为国防科技优秀图书一等奖；多次荣获“北京科技大学先进工作者”称号。','/img1/27.jpg'),(0,NULL,'王书玮',323,'王书玮，2006年毕业于日本千叶大学人文社会学研究科之后进入北京科技大学工作至今。进校后在教学上兢兢业业，每年都做班导师，曾获得“我爱我师—我心中最优秀教师”奖、北京科技大学第13届“青年教师课堂教学评比”一等奖、北京科技大学第六届“本科教学优秀奖”、 北京科技大学第27届教育教学成果一等奖等十余项校级奖励。以第一作者身份共发表论文30篇，其中日本学会会刊13篇，大学学报9篇，中文核心期刊4篇，外语类专业期刊2篇。主持教育部人文社科基金项目、北京市哲学社会科学基金项目等省部级以上科研教研项目5项。2018年入选全国首批高校“双带头人”党支部书记工作室建设项目。','/img1/28.jpg'),(0,NULL,'王宇',324,'王宇，副教授，硕导。2014年获中国科学院地质与地球物理研究所地质工程博士学位，毕业后在中国科学院地质与地球物理研究所从事2年的博士后工作。主要从事岩土体非线性破裂与渗流方面的研究，以岩土体结构控制论为基础，将地质、工程和岩土力学紧密结合，强调结构因子对岩土体细观力学性质及岩土工程的影响。参与完成或正在进行国家自然科学基金、北京市自然科学基金、973课题、国家“十三五”重点研发计划项目、博士后面上基金、博士后特别资助基金等十余项课题的研究工作；第一作者发表SCI，EI，ISTP论文60余篇，其中SCI论文36篇，EI论文15篇；讲授“岩石力学与工程”本科生课程。','/img1/29.jpg'),(0,NULL,'王竹青',325,'王竹青，教授，硕士研究生导师，对本校的本科主要授予婚姻家庭法、模拟法庭实务两门课程，对研究生主要开设了民法基本理论和法律诊所。2001-2004中国人民大学民商法学博士，1989-2001石家庄市长安区法院法官，2004-至今北京科技大学法律系教授，主持国家社科基金重大课题“中国特色社会主义法治体系建设中的妇女权益保障研究”之子课题“妇女财产权益与婚姻家庭权益保障研究”，主持教育部一般社科规划课题“农村婚姻家庭法律问题研究”，主持联合国教科文组织的课题“家政工劳动权益保护法律问题研究”。2018年7月，获中国法学会婚姻法学研究会2017-2018年度优秀科研成果论文类二等奖；2016年10月，当选为中国法学会婚姻法学研究会第八届理事会理事。','/img1/30.jpg'),(0,NULL,'吴群芳',326,'吴群芳，教授，公共管理系主任。在北京大学政治学与行政管理系（现政府管理学院）先后获法学学士、硕士、博士学位，2006年破格晋升为副教授，2012年晋升教授。独立主持国家社会科学基金项目“转型期中国的收入差距与政府控制”并以“良好”等级结项，主持教育部人文社科研究规划项目（“群体性事件频发背景下公民有序利益表达研究”）、中央高校基本科研业务费优秀青年人才培养基金项目等多个项目，作为子项目负责人参与国家社会科学基金项目和教育部人文社会科学重点研究基地重大项目4项，2009年入选北京市新世纪社科理论人才百人工程，被评为全国公共管理硕士（MPA）优秀教学管理工作者，在“我爱我师”评选中先后四度当选专业课“我心目中最优秀的老师”。','/img1/31.jpg'),(0,NULL,'武会宾',327,'武会宾，博导，中国金属学会轧钢分会焊管学术委员会委员。2000年在河北工业大学材料科学与工程学院获学士学位，2006年在北京科技大学材料科学与工程学院获博士学位，2013-2014年美国韦恩州立大学工程学院访问学者。作为课题负责人承担了国家重点研发计划、自然基金、科技支撑计划、重大专项等15项国家科研项目，50多项校企合作项目；已指导或协助指导研究生60余名，发表学术论文200余篇，获得授权发明专利26项，省部级科技进步一等奖2项，二等奖1项，三等奖5项。','/img1/32.jpg'),(0,NULL,'夏德宏',328,'夏德宏，教授，博导，副院长。科研方向为节能环保新工艺、新装备、新材料，清洁能源开发与能源的清洁利用，热科学与能源工程。在联合国开发计划署（UNDP）的支持下，作为能源与环保领域的专家多次出访国外，和国外很多大学、研究机构和有关公司保持着紧密的合作关系。参加和参与组织了十余次在国际上有重大影响的大型国际学术会议，例如International Conference on Coal Combustion Technology in Pittsburgh，USA，International Conference on Clean Coal Technology & Utilization in Florida，USA，Fine Particle Technology Symposium in Las Vegas，USA等。作为高级访问学者，在The Catholic University of America 进行了较为深入的洁净能源与能源高效利用方面的合作研究，取得了满意的合作成果。与国外一些大学和公司有着长期的实质性项目合作和交流，例如美国的The Catholic University of America，印度尼西亚的PT. Bentonit Alam Indonesia，美国的Lanheat Corporation of USA等。','/img1/33.jpg'),(0,NULL,'肖文栋',329,'肖文栋，教授，博导。IEEE高级会员（Senior Member）、ACM会员，IEEE交互式可穿戴技术与设备专家委员会委员，中国生物医学学会健康工程分会委员，中国系统仿真学会智能物联系统专业委员会委员，国家自然科学基金委评审专家，中国博士后基金评审专家，民政部养老服务业十三五规划专家，2016年工信部智能制造专项评审专家。1990年获得东北大学数学系学士学位。1995年获得东北大学自动控制系博士学位。曾担任东北大学信息科学与工程学院副教授，韩国浦项钢铁公司技术研究所博士后研究员，新加坡科技研究局（A*Star）资讯通信研究院(I2R)高级研究员、科学家III，无线定位研究组组长，A*Star博导。2011年开始在北京科技大学工作至今。2011年9月，获新加坡科技研究局航空计划成就奖。','/img1/34.jpg'),(0,NULL,'闫海',330,'闫海，教授，博导,副院长。研究领域包括益生菌的培养与应用；微生物生物能源；有机污染物的生物降解等领域。1985年毕业于大连水产学院海洋渔业系，获得工学学士学位；毕业后先后在农业部、中国科学院任职；1996年于日本大阪大学生物化学工学实验室从事盐生杜氏藻的培养与控制研究；1998年从联合国教科文组织 (UNESCO) 微生物研究生班毕业；2002年毕业于中国科学院研究生院，获得理学博士学位。科研业绩包括国家自然科学基金“微囊藻毒素降解酶的特性和催化机理研究”；教育部博导基金“微囊藻毒素降解酶的分离纯化和催化机理研究”；校企产学研合作基地项目“益生菌的优化培养控制与应用研究”，并多次在核心刊物发表相关突破性进展的文章，受到业内人士们的广泛关注和引用。','/img1/35.jpg'),(0,NULL,'杨武',331,'杨武，教授，博导，高级技师。清华大学中国企业成长与经济安全研究中心知识产权领域首席研究员，国家自然科学基金评审专家、深圳市决策咨询委员会核心专家、知识产权组副组长，国家矿产资源节约与综合利用专项评审专家组专家，中钢协企业管理创新奖评审专家。中国高等教育学会创新创业教育分会专家委员，中国技术经济学会创新创业分会副理事长。从2010年进入北京科技大学开始，培养了8届，共21名硕士研究生，是同期全系带研究生最多的导师，平均年均带2.6名/年，研究生全部顺利通过答辩，多人获得优秀论文、三好学生、国家奖学金。指导了40多名MBA和工程硕士、10多名EMBA和6名博士生，已经发表论文13篇，其中国家自然基金委重要期刊论文4篇，特别是近2年来，每年有一位博士生获得国家奖学金。','/img1/36.jpg'),(0,NULL,'余伟',332,'余伟，博导，研究领域为材料组织与性能控制，材料加工新工艺与新装备。1986.9-1990.7，武汉科技大学，冶金系金属压力加工专业，学士；1990.9-1993.3，北京科技大学，压力加工系，硕士；2002.9-2008.6，北京科技大学，材料科学与工程学院，博士。1993-2000，北京科技大学，材料科学与工程学院  讲师，2000-2009，北京科技大学，高效轧制国家工程研究中心，副研究员，2009-至今，北京科技大学，工程技术研究院，研究员。2008年科技部和奥组委颁发的科技奥运先进个人；2008年江西省科技进步一等奖，2009年江苏省科技进步三等奖，2010年冶金科学技术奖三等奖，2010年江苏省科技进步二等奖，2011年冶金科学技术奖三等奖，2012年福建省科技进步二等奖。2017年河北省科技进步三等奖。2014年获得北京科技大学先进师德个人，先进工作者。','/img1/37.jpg'),(0,NULL,'臧鸿雁',333,'臧鸿雁，从事非线性系统同步理论，混沌理论，混沌密码领域的研究。2014-2018年，主持北京信息科学技术研究院项目2项，主持基本科研业务费1项。自任教以来，认真负责严谨求实，注重学生的创新意识和创新能力的培养。2011年获得第七届北京市青年教师教学基本功比赛一等奖，同时获得最佳教案奖和最佳演示奖。2013年入选北京科技大学青年教学骨干人才项目。主持或参加多项教学项目，并能积极承担青年教师的培养和数学学科教学团队建设工作，在青年教师中起到了模范带头作用。2016年被学生评为“我爱我——我心目中最优秀的老师”。2017年获得北京科技大学教学名师称号。2017年，获北京市高等教育教学成果奖二等奖（排名第二）。2018年，获第四届全国高校数学微课程教学设计竞赛北京市特等奖，华北赛区特等奖，全国一等奖。','/img1/38.jpg'),(0,NULL,'张虎',334,'张虎，副教授，北京科技大学材料科学与工程学院。从事新型磁性功能材料研究，曾在美国能源部Ames实验室、博伊西州立大学留学。材料科学与工程学院国际班教学负责人，获“北京科技大学全英文示范课”、“北京科技大学优秀班导师”。在Advanced Electronic Materials，Acta Materialia，Carbon等国际期刊发表高水平SCI论文近70篇，被引近900次。申请国家发明专利15项，国际专利1项，授权专利5项。担任“全国磁热效应材料和磁制冷技术学术研讨会”组委会委员及Scientific Reports期刊编辑。已指导毕业3届研究生5人，连续3届研究生均获得“国家奖学金”，并获“北京市优秀研究生”、“北京科技大学优秀研究生”、“研究生学术之星”等多项荣誉。协助指导1名博士生，获“2016中国物理年会最佳海报奖”，并获“国家公派留学生奖学金”。','/img1/39.jpg'),(0,NULL,'张剑',335,'张剑，教授，博导，2003年首都师范大学心理系博士研究生毕业，获博士学位，同年9月北京科技大学作博士后研究工作。2009年晋升为教授，2010年被批准为企业管理方向博导。2012年起担任东凌经济管理学院工商管理系主任。目前担任“南开管理评论”，“管理学报”，“心理学报”，“Psychological Reports”，“Journal of Managerial Psychology”等杂志匿名审稿人。专著《员工情绪与管理》荣获第二届中国大学出版社图书奖专著类一等奖；编著教材《现代企业人力资源管理理论与实务》荣获北京科技大学第25届研究生类教育教学成果二等奖。以第一作者或通讯作者身份在Management Decision，Frontiers in Psychology，Social Behavior and Personality等SSCI/SCI检索的国际期刊及《中国管理科学》、《管理评论》等国内A类期刊及其他国内外专业学术期刊及学术会议发表论文110篇。指导学生中，已毕业获得博士学位的有8人，包括留学生博士3人；获得硕士学位的有141人。','/img1/40.jpg'),(0,NULL,'张雷',336,'张雷，博导，担任材料失效与控制研究所副所长，中国腐蚀与防护学会环境敏感断裂专业委员会秘书长，美国腐蚀工程师协会中国学生分会指导教授。2005年至今，连年承担《腐蚀与防护》、《金属腐蚀学》、《耐蚀材料与防护技术》、《环境断裂理论》等本科和研究生教学，指导硕士生毕业22人、博士生毕业6人。先后负责国家自然科学基金4项、国家重点研发计划子课题1项、国际合作项目1项，负责石油石化钢铁公司科研项目35项。累计发表SCI/EI论文70余篇，近5年第一/通讯作者SCI/EI论文30余篇，参编论著5部，获专利9项、参编国标1项、获行业科技奖1项。主要科研工作紧密服务于我国深水和高含硫油气田开发及管道设施安全保障。成果直接服务于国家深水开发，在我国首个1500水深荔湾3-1深水气田得到应用。','/img1/41.jpg'),(0,NULL,'张卫冬',337,'张卫冬，博导，北京科技大学昌平创新园区管理委员会主任、国家材料服役安全科学中心总指挥。2004年毕业于北京科技大学信息工程学院，获博士学位；2010-2011年在美国佐治亚理工学院做访问教授。2009年入选北京市科技新星，同年获北京市“五四奖章”标兵称号，2010年成为美国INFORMS学会会员。长期从事多传感器监检测、智能控制、系统服役可靠性与寿命预测等方面的科研工作，在无人驾驶、高速列车关键部件、高精密电主轴、新能源汽车等方面开展应用研究。先后主持、参加国家863项目、国家科技支撑计划项目、国家自然基金项目以及企业合作项目等10余项。现已发表学术论文50余篇，获批发明专利9项，北京市科技进步奖1项。组织国际学术会议10余次，牵头形成了一支包含国际知名专家、领域专家的跨学科研究团队。','/img1/42.jpg'),(0,NULL,'左海滨',338,'左海滨，教授，博导。2005年在纽约获得“Willy-Korf杰出青年奖”，2006年获得北京市青年岗位能手称号。2006年“铜冷却壁制造与应用”荣获国家科技进步二等奖；2008年“操作平台型高炉专家系统的开发和应用”荣获冶金科学技术奖一等奖；主持和承担国家科技支撑项目课题、“973”课题、国家自然科学基金重点和面上项目，以及企业合作等科研项目三十余项。在中、外核心期刊和国内、国际会议发表学术论文100余篇。','/img1/43.jpg');
